import React from "react";
import { Jumbotron, Container } from "reactstrap";
import styled, { keyframes } from "styled-components";
import { rotateInDownLeft, rotateInDownRight, bounce } from "react-animations";
// , { keyframes }
// import Pulse from "@bit/formidablelabs.react-animations.pulse";

// const PulseAnimation = keyframes`${Pulse}`;
// const PulseDiv = styled.div`
//   animation: infinite 5s ${PulseAnimation};
// `;

const Padding = styled.div`
  width: 80%;
  margin: 1% auto;
`;
const Animate = styled.div`
  classname: rotateInDownLeft;
  classname: rotateInDownRight;
`;

const BodyComp = props => {
  return (
    <Padding>
      <Jumbotron fluid>
        <Container fluid>
          <Animate>
            <h1>Chill, it's just an App</h1>
            <p>
              Are you having a strong REACTion to how awesome this app is,
              considering the builder thought a library was just that really
              cool place with all of the books two weeks ago? I don't blame you
              but you have to chill, it's just an app!
            </p>
          </Animate>
        </Container>
      </Jumbotron>
    </Padding>
  );
};

export default BodyComp;
